//The mouseover function for menu-elements with submenu
CMSMenuitem.mouse_over_children = function (){	
	var $this = $(this),
		thismenu = $this.parent(),
		submenu = $this.children('ul'),
		menuItems = thismenu.children('li');

	if (thismenu.hasClass('horizontalmenu')) {
		submenu.css({
			'position': 'absolute',
			'top': thismenu.outerHeight() + 'px'
		}).fadeIn(100);
	} else if (thismenu.hasClass('verticalmenu')) {
		submenu.css({
			'position': 'absolute',
			'top': $this.parentOffset().top,
			'left': thismenu.outerWidth() + 'px'
		}).fadeIn(100);
	} else if (thismenu.hasClass('website_menubase') && menuItems.length > 2) {
		if ($(menuItems[1]).offset().top < $(menuItems[2]).offset().top) {
			submenu.css({
				'position': 'absolute',
				'top': $this.offset().top - thismenu.offset().top,
				'left': thismenu.outerWidth() + 'px'
			}).fadeIn(100);
		} else {
			submenu.css({
				'position': 'absolute',
				'top': thismenu.outerHeight() + 'px'
			}).fadeIn(100);
		}
	} else {
		submenu.css({
			'position': 'absolute',
			'left': thismenu.outerWidth() + 'px'
		}).fadeIn(100);
	}
};

CMSMenuitem.mouse_out_children = function (){
	$(this).children('ul').fadeOut(100);
};

$(document).ready(function () {
	$('.website_menubase .haschildren').hoverIntent({
		interval: 0,  
		sensitivity: 4, 
		over: CMSMenuitem.mouse_over_children, 
		timeout: 200,  
		out: CMSMenuitem.mouse_out_children  
	})
});


